import React from "react";
import {FormGroup,InputLabel} from "@mui/material";
import { FormControl } from "@mui/base";
function Contact(){
    return(
        <div>
            <h1>Contact Form</h1>
            <FormGroup>
               <FormControl>
                <InputLabel>Name:</InputLabel>
                </FormControl> 
            </FormGroup>
        </div>
    )
}
export default Contact
